import "./booklist.css"
import axios from "axios"
import { useState } from "react"
import { useEffect } from "react";
import { Link } from "react-router-dom";
import Register from "../register/Register";

export default function Booklist() {
    const [user, setUser] = useState([]);
    useEffect(()=>{
        const fetchUser = async () => {
            const res = await axios.get("/books")
            // setUser(res.data)
            console.log("hello", res);
            setUser(res.data)

        }
        fetchUser();
    },[] )
  return (
    <div>

<button className="loginRegisterButton" component={Register} to="/register">
     linkkkk
        </button>

   
      <table> 
        <thead>
        <tr>
          <th colSpan="4">Book List</th>
        </tr>
        <tr>
          <th>Book Name</th>
          <th>Author</th>
          <th>Edition</th>
          <th>price</th>
          <th>Copyright</th>
          <th>Title</th>
          <th>Description</th>
         
        </tr>
        </thead>
        {user.map((c) => (
          <tr> 
          <td>{c.bookname}</td>
          <td>{c.author}</td>
          <td>{c.edition}</td>
          <td>{c.price}</td>
          <td>{c.copyright}</td>
          <td>{c.title}</td>
          <td>{c.desc}</td>
         
         
      
         
        
          </tr>
        
      
     

      ))}
      </table>
    </div>
  
  
  )

  
}
